import bootstrap from "bootstrap";
import 'react-bootstrap';
import Form from "react-bootstrap/Form";
import 'bootstrap/dist/css/bootstrap.min.css';


function form() {
    return(
    <>
    <Form.Label htmlFor="inputuser">
        Username
    </Form.Label>
    <Form.Control
        type="text"
        id="inputuser"
    />    
    </>
    );
}
export default form
